import './index.css';
import { Link } from 'react-router-dom';

function Choice() {
    return (
        <div class = "App">
            <div className="hero-image">
                <div class="hero-text">
                    <h1>Part-Time Utopia</h1>
                    <br></br>
                    <Link to = {'./signup'}>
                    <button>Professors</button>
                    </Link>
                    <br></br>
                    <Link to = {'./signin'}>
                    <button>Courses</button>
                    </Link>
                </div>
            </div>
        </div>
    );
  }

  export default Choice;
